function AdminUsers() {
  const users = JSON.parse(localStorage.getItem("users")) || [];

  return (
    <div className="container mt-4">
      <h4 className="fw-bold mb-3">Shopping Cart Users</h4>

      <table className="table table-striped">
        <thead>
          <tr>
            <th>User</th>
            <th>Total Items</th>
            <th>Last Order</th>
          </tr>
        </thead>

        <tbody>
          {users.map((u, i) => (
            <tr key={i}>
              <td>{u.username}</td>
              <td>{u.cart?.length || 0}</td>
              <td>{u.lastOrder || "N/A"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AdminUsers;
